import itertools

def findSubstring(s, words):
    if (len(s)==0 or len(words)==0):
        return []

    n = len(words)*len(words[0])
    l = {}
    for i in range(0, len(s)-n+1):
        l[i] = s[i:i+n]
    
    possible=[]
    
    it = itertools.permutations(words, len(words))

    while True:
        try:
            possible.append("".join(list(next(it))))
        except StopIteration:
            break
    r=[]
    
    for k,v in l.items():
        if v in possible:
            r.append(k)

    return r

s = "barfoothefoobarman"
words = ["foo", "bar"]
print (findSubstring(s, words))

